import React, { Component } from 'react';
import Navbar from '../AdminPage/Navbar';
import Body from './Body';

export default class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            showProduct: null,
            showCustomer: null
        };
    }

    setShowProduct = (func) => {
        this.setState({ showProduct: func });
    };

    setShowCustomer = (func) => {
        this.setState({ showCustomer: func });
    };

    render() {
        return (
            <div>
                <Navbar showProduct={this.state.showProduct} showCustomer={this.state.showCustomer} />
                <Body setShowProduct={this.setShowProduct} setShowCustomer={this.setShowCustomer} />
            </div>
        );
    }
}
